// Inspired by Lee Byron's test data generator.
function bumpLayer(n, o) {

	function bump(a) {
		var x = 1 / (.1 + Math.random()), y = 2 * Math.random() - .5, z = 10 / (.1 + Math.random());
		for (var i = 0; i < n; i++) {
			var w = (i / n - y) * z;
			a[i] += x * Math.exp(-w * w);
		}
	}

	var a = [], i;
	for ( i = 0; i < n; ++i)
		a[i] = o + o * Math.random();
	for ( i = 0; i < 5; ++i)
		bump(a);
	return a.map(function(d, i) {
		return {
			x : i,
			y : Math.max(0, d)
		};
	});
}

// Credit to: http://stackoverflow.com/questions/9400615/whats-the-best-way-to-make-a-d3-js-visualisation-layout-responsive

$(function() {
	var aspect = 700 / 300, chart = $("#d3-chart-1").find("svg");
	var targetWidth = ($("#d3-chart-1").width() - 10);
	chart.attr("width", targetWidth);
	chart.attr("height", targetWidth / aspect);
	$("#d3-chart-1 svg").width(targetWidth);
	$("#d3-chart-1 svg").height(targetWidth / aspect);

	$(window).on("resize", function() {
		var targetWidth = ($("#d3-chart-1").width() - 10);
		chart.attr("width", targetWidth);
		chart.attr("height", targetWidth / aspect);
		$("svg").width(targetWidth);
		$("svg").height(targetWidth / aspect);
	});
});
// Streamgraph
// credits: http://bl.ocks.org/4060954

/* 
   For continuous data such as time series, a streamgraph can be used in place of stacked bars. 
   This example also demonstrates path transitions to interpolate between different layouts. 
   Streamgraph algorithm, colors, and data generation inspired by Byron and Wattenberg.
*/


(function($) {

	var n = 15, // number of layers
	    m = 90, // number of samples per layer
	    stack = d3.layout.stack().offset("wiggle"),
	    layers0 = stack(d3.range(n).map(function() { return bumpLayer(m); })),
	    layers1 = stack(d3.range(n).map(function() { return bumpLayer(m); }));
	
	var width = ($("#d3-chart-2").width()-30),
	    height = 250;
	
	var x = d3.scale.linear()
	    .domain([0, m - 1])
	    .range([0, width]);
	
	var y = d3.scale.linear()
	    .domain([0, d3.max(layers0.concat(layers1), function(layer) { return d3.max(layer, function(d) { return d.y0 + d.y; }); })])
	    .range([height, 0]);
	
	var color = d3.scale.linear()
	    .range(["#E24913", "#FF9F01"]);
	
	var area = d3.svg.area()
	    .x(function(d) { return x(d.x); })
	    .y0(function(d) { return y(d.y0); })
	    .y1(function(d) { return y(d.y0 + d.y); });
	
	var svg = d3.select("#d3-chart-2").append("svg")
	    .attr("width", width)
	    .attr("height", height);
	
	svg.selectAll("path")
	    .data(layers0)
	    .enter().append("path")
	    .attr("d", area)
	    .style("fill", function() { return color(Math.random()); });

})(jQuery);

function transition() {
  d3.selectAll("path")
      .data(function() {
        var d = layers1;
        layers1 = layers0;
        return layers0 = d;
      })
    .transition()
      .duration(2500)
      .attr("d", area);
}

// Inspired by Lee Byron's test data generator.
function bumpLayer(n) {

  function bump(a) {
    var x = 1 / (.1 + Math.random()),
        y = 2 * Math.random() - .5,
        z = 10 / (.1 + Math.random());
    for (var i = 0; i < n; i++) {
      var w = (i / n - y) * z;
      a[i] += x * Math.exp(-w * w);
    }
  }

  var a = [], i;
  for (i = 0; i < n; ++i) a[i] = 0;
  for (i = 0; i < 5; ++i) bump(a);
  return a.map(function(d, i) { return {x: i, y: Math.max(0, d)}; });
}


